import axios from 'axios';

export class Blog extends Component {
    componentDidMount(){
        axios.get(`/api/blog/${this.props.match.params.blog_id}`).then(response => {
            console.log(response.data)
        }).catch(err => console.log(err))
    }
  render() {
    return (
      <div>
        single blog
      </div>
    )
  }
}

export default Blog
